sparqlQueGG:
SELECT ?program (COUNT(?airline) AS ?count) WHERE {
  ?airline a <http://dbpedia.org/ontology/Airline> ;
            <http://dbpedia.org/ontology/frequentFlyerProgram> ?program
} GROUP BY ?program ORDER BY DESC(?count) LIMIT 1

SELECT DISTINCT ?land WHERE {
  ?ort <http://dbpedia.org/ontology/country> ?land .
  ?ort <http://dbpedia.org/ontology/cave> ?höhle .
} GROUP BY ?land HAVING (COUNT(?höhle) > 2)

SELECT DISTINCT ?monarch WHERE {
  ?monarch a <http://dbpedia.org/ontology/Monarch> ;
           <http://dbpedia.org/property/spouse> ?spouse .
  ?spouse a <http://dbpedia.org/ontology/Person> ;
           <http://dbpedia.org/ontology/birthPlace> ?birthplace . 
  FILTER(CONTAINS(str(?birthplace), "Germany") && CONTAINS(str(?monarch), "United_Kingdom"))
}

SELECT DISTINCT ?uri ?elevation WHERE { 
?uri a <http://dbpedia.org/ontology/Mountain> ; 
      <http://dbpedia.org/ontology/range> <http://dbpedia.org/resource/Karakoram> ;
      <http://dbpedia.org/ontology/elevation> ?elevation 
} ORDER BY DESC(?elevation) LIMIT 1

SELECT DISTINCT ?state WHERE {
  ?state a <http://dbpedia.org/ontology/AdministrativeRegion> ;
  <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/United_States> ;
  <http://dbpedia.org/ontology/populationDensity> ?popDensity .
} ORDER BY DESC(?popDensity) OFFSET 0 LIMIT 1

SELECT ?years WHERE { 
<http://dbpedia.org/resource/Ford_Model_T> <http://dbpedia.org/ontology/productionStartYear> ?startYear ;
<http://dbpedia.org/ontology/productionEndYear> ?endYear.
BIND( year(?endYear) - year(?startYear) as ?years) 
}

SELECT ?uri (COUNT(?book) as ?bookCount) WHERE {  
  ?uri rdf:type dbo:Poet .
  ?book dbo:author ?uri . 
} 
ORDER BY DESC(?bookCount)
LIMIT 1

SELECT DISTINCT ?country 
WHERE { 
  ?volcano a <http://dbpedia.org/ontology/Volcano> ; 
           <http://dbpedia.org/ontology/country> ?country . 
} 
GROUP BY ?country 
HAVING (COUNT(?volcano) > 10)

SELECT DISTINCT ?president WHERE {
  ?president <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/President> ;
             <http://dbpedia.org/ontology/country> <http://dbpedia.org/resource/United_States> ;
             <http://dbpedia.org/ontology/termPeriod> ?termPeriod .
  ?termPeriod <http://dbpedia.org/ontology/start> ?start .
  FILTER(YEAR(?start) >= (YEAR(NOW()) - 20))
} ORDER BY ?start

SELECT DISTINCT ?player ?height WHERE { 
?player a <http://dbpedia.org/ontology/BasketballPlayer> ;  
             <http://dbpedia.org/ontology/height> ?height ;
             <http://dbpedia.org/ontology/team> ?team .
?team a <http://dbpedia.org/ontology/BasketballTeam> .
FILTER EXISTS {?player <http://dbpedia.org/ontology/activeYearsStartYear> ?startYear FILTER (?startYear <= NOW())}
} ORDER BY ASC(?height) LIMIT 1

SELECT ?player ?birthDate
WHERE {
  ?player dbo:league <http://dbpedia.org/resource/Premier_League> ;
          dbo:birthDate ?birthDate .
}
ORDER BY DESC(?birthDate)
LIMIT 1

SELECT (COUNT(?river) AS ?Rivers) (COUNT(?lake) AS ?Lakes) WHERE { 
 {?river a <http://dbpedia.org/ontology/River> ; <http://dbpedia.org/ontology/locatedInArea> <http://dbpedia.org/resource/South_Carolina> .}
 UNION 
 {?lake a <http://dbpedia.org/ontology/Lake> ; <http://dbpedia.org/ontology/locatedInArea> <http://dbpedia.org/resource/South_Carolina> .}
}
